import React from 'react';
import styled from 'styled-components';

function Details() {
  return <Container>
      <Background>
        <img src="https://prod-ripcut-delivery.disney-plus.net/v1/variant/disney/9D8AEB7DE234898392BFD20E7D9B112B841E920AF9A3F54CCFB966722AFF3461/scale?width=1920&aspectRatio=1.78&format=jpeg" />
        <ImageTitle>
          <img src="https://static.wikia.nocookie.net/disney/images/1/17/Bao_Logo.jpg/revision/latest/scale-to-width-down/960?cb=20180404191925" />
        </ImageTitle>
      </Background>
  </Container>;
}

export default Details;

const Container = styled.div`
  min-height: calc(100vh - 70px);
  padding: 0 calc(3.5vw + 5px);
  position: relative;
`

const Background = styled.div`
    position: fixed;
    top: 0;
    left: 0;
    bottom: 0;
    right: 0;
    z-index: -1;
    opacity: 0.8;

    img {
      width: 100%;
      height: 100%;
      object-fit: cover;
    }
`

const ImageTitle = styled.div`
   z-index: 1;
`
